import React from 'react';
import {View, Panel, PanelHeader, Group, List, Cell } from '@vkontakte/vkui';

function Catalog ({id ,...props}) {
  return (
  <View id={id} activePanel="feed">
    <Panel id="feed">
      <PanelHeader right={null}>Каталог</PanelHeader>
      <Group title="Items">
          <List>
          <Cell>Hello</Cell>
          <Cell>World</Cell>
          </List>
      </Group>
    </Panel>
  </View>
  );
}

export default Catalog;
